//         <Card 
//             imgsrc={val.imgsrc}
//             title={val.title}
//             sname={val.sname}
//             link={val.link} 
//         />
//     );
// }

ReactDOM.render(
    <>
        <h1 className="heading_style">List of top 5 Netflix series in 2020</h1>
        {/* {sdata.map(ncard)} */}
        {sdata.map((val) => {
            return (
                <Card
                    key = {val.id} 
                    imgsrc={val.imgsrc}
                    title={val.title}
                    sname={val.sname}
                    link={val.link} 
                />
            );
        })}
    </>,
    document.getElementById('root')
);
